import SwiftUI

@MainActor
class DriverRegisterViewModel: ObservableObject {
    @Published var isLoading = false
    @Published var isRegistered = false
    @Published var message = ""
    
    private let repository: DriverRepository
    
    init(repository: DriverRepository =  AppDependencies.shared.makeDriverRepository() ) {
        self.repository = repository
    }
    
    func registerDriver(
//        fullName: String,
//        email: String,
//        phone: String,
//        password: String,
//        gender: String,
//        address: String,
//        carPlate: String,
//        carType: String,
//        carModel: String,
//        carColor: String
    ) async {
        isLoading = true
        defer { isLoading = false }
        
//        let params: [String: Any] = [
//            "fullName": fullName,
//            "email": email,
//            "phone": phone,
//            "password": password,
//            "gender": gender,
//            "address": address,
//            "car_plate": carPlate,
//            "car_type": carType,
//            "car_model": carModel,
//            "car_color": carColor
//        ]
        
        do {
            
            let token = try StorageManager.shared.getAuthToken() ?? ""
            
            let driverRegisterRequest = DriverRegisterRequest(
                token: token,
                carPlate: "MH12AB1234",
                identity: "Aadhar-567890123456",
                brand: "Maruti Suzuki",
                model: "Swift Dzire",
                year: "2022",
                status: "active",
                account: "icici",
                referredBy: "REF12345",
                linkType: "2",
                image: DriverTestObject.Base64EncodingOptions(),      // Driver profile photo
                image2:  DriverTestObject.Base64EncodingOptions(),     // Vehicle photo
                document:  DriverTestObject.Base64EncodingOptions(),      // Example driver license / ID PDF
                documentName: "Driver_License.pdf",
                documentId: "DL-042019-123456",
                documentIdName: "Driving License"
            )

            
            
            
            
            let response = try await repository.registerDriver(driverRegisterRequest)
            message = response.message ?? ""
            if response.isSuccess {
                isRegistered = true
            }
        } catch {
            message = "❌ \(error.localizedDescription)"
        }
    }
}



class DriverTestObject {
    
   static func Base64EncodingOptions() -> String {
        let stringData = "data:image/jpeg;base64,"
        
        return stringData
    }
    
}
